import logo from './logo.svg';
import './App.css';
import Header from './componentes/layout/Header';
import Nav from './componentes/layout/Nav';
import Footer from './componentes/layout/Footer';

import Home from './pages/Home';



function App() {
  return (
    <div className="App">
      <Header/>
      <Nav></Nav>
      <Home/>
      <Footer/>
    </div>
  );
}

export default App;
